            #region Execute Stored Procedure

            Assembly callingAssembly = Assembly.GetExecutingAssembly();
            var sb = new StringBuilder();
            string script;
            foreach (string manifestResourceName in callingAssembly.GetManifestResourceNames())
            {
                using (Stream resourceStream = callingAssembly.GetManifestResourceStream(manifestResourceName))
                {
                    if (resourceStream != null)
                        using (var reader = new StreamReader(resourceStream))
                        {
                            sb.Append(reader.ReadToEnd());
                        }
                }
            }
            script = sb.ToString();
            string[] sqlCommands = script.Split(new[] { "GO", "go", "Go", "gO" }, StringSplitOptions.RemoveEmptyEntries);
            foreach (string sql in sqlCommands)
            {
                if (!string.IsNullOrWhiteSpace(sql))
                    context.Database.ExecuteSqlCommand(sql);
            }

